import React from 'react';

import { Card } from '../card/card.component';

import './card-list.styles.css';

export const CardList = props => {
    return <div className='card-list'>
        {props.plants.map(plant => (
            <Card key={plant.id} plant={ plant }/>
          ))}
    </div>
};
